"use client";
import { useParams, useRouter } from "next/navigation";
import Nav from "../../../components/Nav";
import WorkoutList from "../../../components/WorkoutList";
import WorkoutForm from "../../../components/WorkoutForm";
import { useState } from "react";
import Style from "./page.module.css";

type Workout = {
  id: number;
  workoutName: string;
  reps: number;
  sets: number;
  imageURL: string;
  notes: string;
};
const INIT_WORKOUT: Workout[] = [
  {
    id: 1,
    workoutName: "Bench Press",
    reps: 8,
    sets: 3,
    imageURL:
      "data:image/jpeg;base64,",
    notes: "Push Day (1). Max: 225.",
  },
  {
    id: 2,
    workoutName: "Squat",
    reps: 5,
    sets: 4,
    imageURL:
      "data:image/jpeg;base64,",
    notes: "Legs (1). Max: 275.",
  },
  {
    id: 3,
    workoutName: "Deadlift",
    reps: 6,
    sets: 4,
    imageURL:
      "data:image/jpeg;base64,",
    notes: "Legs (2). Max: 315.",
  },
];

export default function Home() {
  const { username } = useParams();
  const signout = "/";
  const [workouts, setWorkout] = useState<Workout[]>(INIT_WORKOUT);

  const addWorkout = (newWorkout: Workout) => {
    setWorkout([...workouts, newWorkout]);
  };
  const router = useRouter();
  const close = () => {
    router.push("./");
  };
  return (
    <div>
      <Nav username={username as string} url={signout} />
      <div className={Style.container}>
        <WorkoutList workouts={workouts} />
        <WorkoutForm onAddWorkout={addWorkout} onClose={close} />
      </div>
    </div>
  );
}
